// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom'; // Importez BrowserRouter
import Routes from './routes'; // Importez le composant Routes
import Home from './pages/Home';
import Appartements from './pages/Appartements';
import NotFound from './pages/NotFound';

const root = ReactDOM.createRoot(document.getElementById('root'));

// Utilisez la méthode render de root pour afficher les routes enveloppées dans un Router
root.render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/appartements" element={<Appartements />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  </React.StrictMode>
);
